column8:
フォーク＆ケース付きのステンレス保温ジャー付のお弁当箱です。<br>
手提げランチバッグ付なのでお弁当箱をすっきり収納！持ち運びも便利でかわいいですね。<br>
菜入れ容器は電子レンジＯＫ！<br>
※飯器は電子レンジ加熱できません。<br>
バッグのふた内側にはふりかけやフォークの収納に便利なメッシュポケット付きです。(下段画像は別柄ですがご参照下さい）<br>
<br>
<font color="#0000cd">※こちらの商品は食洗機は非対応となります。</font>
<br><br>
■セット内容<br>
・ご飯入れ(240ml／ステンレス保温ジャー)<br>
※ご飯茶わん約1.2杯分（目安／茶わん１杯＝200ml)<br>
・菜入れ(160ml×２個)<br>
・ランチバッグ<br>
・フォーク＆ケース<br>
<br>
■総容量：560ml<br>
<br>
■商品サイズ：約102×178×115mm<br>
<br>
■保温効力45度以上（６時間）<br>
※保温効力とは室温20度において内びんに熱湯を満たし、製品付属の飯器ふたをして縦置きにした状態で湯温が95度の時から６時間放置した場合におけるその湯の温度。<br>
<br>
※バッグは丸洗いできませんので、汚れた場合は柔らかい布等で拭き取って下さい。<br>
<br>
≪品質表示≫<br>
■保温ジャー<br>
・本体：ステンレス鋼（アクリル樹脂塗装)　耐熱温度140度<br>
・フタ：ポリプロピレン(発泡ウレタン）耐熱温度140度<br>
・パッキン：シリコン樹脂　耐熱温度140度<br>
<br>
■菜入れ<br>
・本体：ポリプロピレン　耐熱温度140度<br>
・フタ：ポリエチレン　耐熱温度70度<br>
■フォーク<br>
・フォーク先：ステンレス鋼　耐熱温度70度<br>
・フォーク柄：ＡＢＳ樹脂　耐熱温度100度<br>
■フォークケース<br>
・本体：ＡＢＳ樹脂　耐熱温度100度<br>
・フタ：メタクリル樹脂　耐熱温度100度<br>
■ランチバッグ<br>
ポリエステル（中材：発泡ポリエチレン）<br>
<br>
【関連ワード】<br>
保温弁当箱/あったか/ご飯/ランチジャー /お弁当箱/ランチグッズ/ピクニック/行楽/遠足/運動会/スケーター
<br>
<br>【Made in China】<BR>

