あったかいスープやご飯に、おかずをプラス！！<br>
<br>
保温ジャーに温かいスープやご飯、<br>
冷たいデザートなどを入れてコンビランチに♪<br>
<br>
折りたたみ先割れスプーン付き☆彡<br>
<br>
○容　量<br>
　ジャー：２５０ml<br>
　菜入れ：１５０ml<br>
<br>
○商品サイズ:約 直径92mm×高さ184mm<br>
<br>
○保温効力：４７度以上（６時間）<br>
○保冷効力：１３度以下（６時間）<br>
<br>
≪品質表示≫<br>
・フタ、中ブタ：ポリプロピレン<br>
・折りたたみスプーン<br>
　　スプーン先：ステンレス鋼<br>
　　スプーン柄：ＡＢＳ樹脂<br>
・菜入れ<br>
　　本体、フタ：ポリプロピレン<br>
　　パッキン：シリコーン<br>
・保温保冷ジャー<br>
　　本体：ステンレス鋼(アクリル樹脂塗装)<br>
　　フタ：ポリプロピレン(発泡スチロール)<br>
　　パッキン：シリコーン<br>
　　底板：エラストマー樹脂<br>
<br>【Made in China】<BR>

