ドットール・ヴラニエス　リネンフレグランス （フレグランスリネンスプレー） エアー ARIA 250ml<BR><hr><br>
【タイプ】ARIA (空気)<br>
シトラス、ベルガモットそして満開のミモザと、モス、ホワイトムスクが<br>
調和するフレッシュで繊細な香り。<br>
カーテンやベッドリネン、衣類に吹きかけるフレグランス。<br>
洗いたてのリネンのような、すがすがしい香りが広がります。<br><br>
【内容量】<br>
※30cm程度離してご使用下さい（アイロンのスチームタンクに入れないで下さい）<br>
※素材によってはシミになる場合があります　目立たない場所で試してからご使用ください。<br>
・飲物ではありません。万が一飲み込んだ場合は、医師の診断を受けてください。<br>
・目に入らないようにご注意ください。もし入った場合は水で良く洗い流し、医師の診断を受けてください。<br>
・直接肌に付けないよう、また吸い込んだりしないようご注意ください。<br>
・高温・多湿・直射日光を避けて保管してください。<br>
